    // Function to populate the table
    function populateTableWithJSON(tableID, tableJSON) {
      const panelsTableBody = document.querySelector(`#${tableID} tbody`);

      // cant use forEach on JSON object
      for (const [key, value] of Object.entries(tableJSON)) {
        // Create and append Panel Type cell
        const row = document.createElement("tr");
        const panelTypeCell = document.createElement("td");
        panelTypeCell.className = "border px-2 py-1";
        panelTypeCell.textContent = key;
        row.appendChild(panelTypeCell);
  
        // Create and append Quantity cell
        const quantityCell = document.createElement("td");
        quantityCell.className = "border px-2 py-1";
        quantityCell.textContent = value;
        row.appendChild(quantityCell);
      
        panelsTableBody.appendChild(row);
      }
    }

    // Fetch and display the image
    const imageData = getQueryParam("image");
    if (imageData) {
      const imageElement = document.getElementById("designImage");
      imageElement.src = decodeURIComponent(imageData);
    }

    // Fetch and populate the table
    const tableData = getQueryParam("table");
    if (tableData) {
      try {
        const tableJSON = JSON.parse(decodeURIComponent(tableData));
        populateTableWithJSON('panelsTable', tableJSON['panels']);
        populateTableWithJSON('boxesTable', tableJSON['boxes']);
      } catch (e) {
        console.error("Error parsing table data: ", e);
      }
    }
